import React, { useState, useEffect } from "react";
import authenticatedFetch from "./authenticatedFetch";

function SegmentUsers({ segmentId }) {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    authenticatedFetch(
      `https://vigilant-orbit-v6x6pp4w99636w9v-3000.app.github.dev/users-by-segment/${segmentId}`
    )
      .then((response) => response.json())
      .then((data) => setUsers(data))
      .catch((error) => console.error("Error fetching users for segment:", error));
  }, [segmentId]);

  if (loading) return <div>Loading...</div>;

  return (
    <div className="p-4 shadow-lg">
      <h2 className="text-2xl font-bold mb-4">Segment Users</h2>
      <div className="overflow-x-auto">
        <table className="w-full text-sm text-left text-gray-500 dark:text-gray-400">
          <thead className="text-xs text-gray-700 uppercase bg-gray-200 dark:bg-gray-700 dark:text-gray-400">
            <tr>
              {/* ... Table headers ... */}
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user._id} className="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                {/* ... User data cells ... */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default SegmentUsers;
